Mongodb $and operator doesn't work as expected<p>I have a basic social media app that allows users to follow each other. When need to find some specific persons "followers", i look for users who have the id of this specific person in their "following"s;</p>

<pre><code>{
          $and: [
            {
              $and: [
                {
                  "following.userId": mongoose.Types.ObjectId(targetId)
                },
                {
                  "following.following": true
                }
              ]
            },
            {
              $or: [{ firstName: firstNameRegex }, { lastName: lastNameRegex }]
            },
            { blockedUsers: { $nin: mongoose.Types.ObjectId(req.userId) } }
          ]
        };

</code></pre>

<p>If a user stops following someone, "following.following" property becomes false.
When run this query, I get every person who has followed that specific person in some time without looking "following.following": true property at all.
"following.following" doesn't evaluate the times when "following.userId" matches, rather it looks for whole array and matches if some of them has "following.following" true.</p>

<p><a href="https://i.stack.imgur.com/6VDi8.png" rel="nofollow noreferrer">Here is the file structure</a></p>

