embedfield:
Best way to upload file with text inputs<p>I am trying to create an item where users will be able to upload a file image, that uploads the file to amazon s3, and returns a string for the image address that should be passed into mongoDB as a single document along with text inputs such as name of item, description, dates etc.</p>

<p>So far I have created a simple mongoDB model with a name and an image to test uploading a file with one text input, but when I try to test it in postman using <strong>form-urlencoded</strong>, there is no option to select a file, and if i try to test it in <strong>form-data</strong>, I get an empty string for the name input, but my code does read the file and return a string for the file, just not both together.</p>

<p>My code is:
setup file for amazon s3</p>

<pre><code>const multer = require("multer");
const multerS3 = require("multer-s3");

const { secret_key, access_key, bucket_name } = require("../config/config");

aws.config.update({
    secretAccessKey: secret_key,
    accessKeyId: access_key,
    region: "us-east-2"
});

const s3 = new aws.S3();

const fileFilter = (req, file, cb) =&gt; {
    if (file.mimetype === "image/jpeg" || file.mimetype === "image/png") {
        cb(null, true);
    } else {
        cb(new Error("Invalid Mime Type, only JPEG or PNG"), false);
    }
};

const upload = multer({
    fileFilter: fileFilter,
    storage: multerS3({
        s3: s3,
        bucket: bucket_name,
        acl: "public-read",
        metadata: function(req, file, cb) {
            cb(null, { fieldName: file.fieldname });
        },
        key: function(req, file, cb) {
            cb(null, Date.now().toString());
        }
    })
});

module.exports = upload;
</code></pre>

<p>controller file for the upload at the target route</p>

<pre><code>const upload = require("../services/file-upload");
const singleUpload = upload.single("img");

let uploadArtefact = (req, res) =&gt; {
    const { name } = req.body;
    singleUpload(req, res, err =&gt; {
        if (err) {
            return res.status(422).send({
                errors: [{ title: "File Upload Error", detail: err.message }]
            });
        }

        let artefact = new Artefact({
            name: name,
            img: req.file.location
        });

        if (!name) {
            return res.json({
                success: false,
                error: "Invalid Inputs"
            });
        }
        artefact.save(err =&gt; {
            if (err) {
                return res.json({ sucess: false, error: err });
            }
            return res.json({ success: true });
        });
    });
};

module.exports = uploadArtefact;

</code></pre>

<p>So I was wondering what would be the best approach to this? Is there a way to submit files with text in one request? I would preferably want to be able to find a way to send them both together.</p>

